post_text:
Congratulations to 2020 Senior Thunderbird Kyle Teel for earning the New Jersey Gatorade Baseball Player of the Year Award. He is Mahwah High Schools first recipient in any sport for this prestigious honor. Way to go Kyle! #MahwahConnects
@VarsityAces
@NJScom
